function makeid(length) {
    var result = '';
    var characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    var charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
        result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }
    return result;
}
function TTTPT(text) {
    text = text.trim();
    const elm_str = (s) => {
        var a = s.toLowerCase().split("");
        a[0] = a[0].toUpperCase();
        return a.join("");
    };
    const char_chk = (s) => /^[a-zA-Z]*$/.test(s);
    var data = [];
    var error = [];
    var cursor_pos = 0;
    var cursor_select = 2;
    while (cursor_pos < text.length) {
        const new_text = elm_str(text.substring(cursor_pos, cursor_pos + cursor_select));
        const pt_data = periodic_table_charmap[new_text];
        const one = periodic_table_charmap[new_text[0]];
        const two = periodic_table_charmap[new_text[1]];
        if (!char_chk(new_text[0])) {
            console.log("special 1");
            cursor_pos += 1;
            continue;
        }
        if (pt_data == undefined) {
            if (one == undefined) {
                if (two == undefined) {
                    error.push({ "start": cursor_pos, "length": 2 });
                    cursor_pos += cursor_select;
                }
                else {
                    data.push(two);
                    error.push({ "start": cursor_pos, "length": 1 });
                    cursor_pos += cursor_select;
                }
            }
            else {
                if (!char_chk(new_text[1])) {
                    console.log("special 2");
                    cursor_pos += cursor_select;
                }
                else {
                    cursor_pos += 1;
                }
                data.push(one);
            }
        }
        else {
            data.push(pt_data);
            cursor_pos += cursor_select;
        }
    }
    return {
        "data": data,
        "error": error
    };
}
